import React from "react";
import './Project.css'
function Project(){
    return (
    <div className="proj">
     <div className="projheader">
         <h1>MY PROJECTS</h1>
         <h2>ENJOYED AND LEARNT A LOT WHILE DEVELOPING THESE PROJECTS</h2>
     </div>
   </div>
  );
}

export default Project;
